import React, { useState } from 'react';



const Info = props => {

    //Database Stuff here
    const [name, setName] = useState('Dan');
    const [age, setAge] = useState('26');
    const [job, setJob] = useState('Coder');
    const [count, setCount] = useState('0');

    return (
    //Send down the info, render the chat shit
            <Chatty 
                name={name}
                age={age}
                job={job}
                count={count}
                setCount={setCount}
            />
    )
}

export default Info;
